INSERT INTO `problem` VALUES (1,'Balloons in a Box',1,15,'There are pairs of integers. Ouput the sum of each pair of integers.','#include <iostream>\r\n#include <cstdio>\r\n#include <cstring>\r\n#include <cmath>\r\nusing namespace std;\r\nint n,t;\r\nint x1[3],x2[3];\r\nint b[6][3];\r\ndouble ans;\r\nint color[6];\r\ndouble r[6];\r\ndouble thi;\r\nint sqr(int y1){\r\n	return y1*y1;\r\n}\r\ndouble dis(int y1[3],int y2[3]){\r\n	double sum=0;\r\n	int i;\r\n	for(i=0;i<3;i++)sum+=sqr(y1[i]-y2[i]);\r\n	return sqrt(sum);\r\n}\r\nint re[7];\r\nvoid deal(int p){\r\n	int i;\r\n	double mr=10000000000.0;\r\n	for(i=0;i<p;i++){\r\n		double t=dis(b[re[i]],b[re[p]])-r[re[i]];\r\n		if(t<0){r[re[p]]=0;return;}\r\n		if(t<mr)mr=t;\r\n	}\r\n	for(i=0;i<3;i++){\r\n		if(b[re[p]][i]-x1[i]<mr)mr=b[re[p]][i]-x1[i];\r\n		if(x2[i]-b[re[p]][i]<mr)mr=x2[i]-b[re[p]][i];\r\n	}\r\n	r[re[p]]=mr;\r\n}\r\nvoid dfs(int p){\r\n	int i;\r\n	if(p==n){\r\n		for(i=0;i<n;i++){\r\n			re[color[i]-1]=i;\r\n		}\r\n		memset(r,0,sizeof(r));\r\n		thi=0;\r\n		for(i=0;i<n;i++){\r\n			deal(i);\r\n		}\r\n		double sum=0;\r\n		for(i=0;i<n;i++){\r\n			sum+=r[i]*r[i]*r[i]*acos(0)*8/3;\r\n		}\r\n		if(sum>ans){\r\n			//for(i=0;i<n;i++)cout<<r[i]<<endl;\r\n			ans=sum;\r\n		}\r\n		return;\r\n	}\r\n	for(i=0;i<n;i++){\r\n		if(!color[i]){\r\n			color[i]=p+1;\r\n			dfs(p+1);\r\n			color[i]=0;\r\n		}\r\n	}	\r\n}\r\nvoid cal(){\r\n	memset(color,0,sizeof(color));\r\n	ans=0;\r\n	dfs(0);\r\n}\r\nvoid solve(){\r\n	cal();\r\n	int i;\r\n	double v=1;\r\n	for(i=0;i<3;i++)v*=(x2[i]-x1[i]);\r\n	//printf(\"Box %d: %d\\n\\n\",t,(int)(v-ans+0.5));\r\n	printf(\"%d\\n\",(int)(v-ans+0.5));\r\n}\r\nint main(){\r\n	int i,j;\r\n	t=1;\r\n	while(scanf(\"%d\",&n)!=EOF){\r\n		if(n==0)break;\r\n		for(i=0;i<3;i++)scanf(\"%d\",&x1[i]);\r\n		for(i=0;i<3;i++)scanf(\"%d\",&x2[i]);\r\n		for(i=0;i<3;i++){\r\n			if(x1[i]>x2[i]){\r\n				int t=x1[i];\r\n				x1[i]=x2[i];\r\n				x2[i]=t;\r\n			}\r\n		}\r\n		for(i=0;i<n;i++){\r\n			for(j=0;j<3;j++){\r\n				scanf(\"%d\",&b[i][j]);\r\n			}\r\n		}\r\n		solve();\r\n		++t;\r\n	}\r\n	return 0;\r\n}','\r\nimport java.io.FileNotFoundException;\r\nimport java.io.IOException;\r\nimport java.text.DecimalFormat;\r\nimport java.util.HashSet;\r\nimport java.util.Scanner;\r\n\r\n/**\r\n *\r\n * @author MicroSky\r\n */\r\npublic class Main {\r\n\r\n    private static double MaxSum;\r\n    private static Point[] rectangular;\r\n    private static int n;\r\n\r\n    public static void main(String[] args) throws FileNotFoundException, IOException {\r\n        Scanner scan = new Scanner(System.in);\r\n\r\n\r\n        n = scan.nextInt();\r\n        int count = 0;\r\n        while (scan.hasNext()) {\r\n            count++;\r\n\r\n            rectangular = new Point[2];\r\n            for (int i = 0; i < 2; ++i) {\r\n                rectangular[i] = new Point(new int[3]);\r\n                for (int j = 0; j < 3; ++j) {\r\n                    rectangular[i].getPos()[j] = scan.nextInt();\r\n                }\r\n            }\r\n            Point[] points = new Point[n];\r\n            for (int i = 0; i < n; ++i) {\r\n                points[i] = new Point(new int[3]);\r\n                for (int j = 0; j < 3; ++j) {\r\n                    points[i].getPos()[j] = scan.nextInt();\r\n                }\r\n            }\r\n            MaxSum = 0;\r\n            Point[] serchPoints = new Point[n];\r\n            for (int i = 0; i < n; ++i) {\r\n                serchPoints[i] = new Point(new int[3]);\r\n            }\r\n            HashSet<Integer> HaveSearch = new HashSet<Integer>();\r\n            AllSearch(HaveSearch, n, 0, serchPoints, points);\r\n            double area = 1.0;\r\n            for (int j = 0; j < 3; ++j) {\r\n                area *= Math.abs(rectangular[0].getPos()[j] - rectangular[1].getPos()[j]);\r\n            }\r\n            DecimalFormat df = new DecimalFormat(\"#\");\r\n            System.out.println(\"Box \" + count + \": \"+ df.format(area - MaxSum));\r\n            System.out.println();\r\n            n = scan.nextInt();\r\n        }\r\n    }\r\n\r\n    public static void AllSearch(HashSet<Integer> HaveSearch, int n, int deep, Point[] serchPoints, Point[] points) {\r\n        if (deep == n) {\r\n            FindAnswer(serchPoints);\r\n        }\r\n        for (int i = 0; i < n; ++i) {\r\n            if (HaveSearch.contains(i) == false) {\r\n                HaveSearch.add(i);\r\n                serchPoints[deep] = points[i];\r\n                AllSearch(HaveSearch, n, deep + 1, serchPoints, points);\r\n                HaveSearch.remove(i);\r\n            }\r\n        }\r\n    }\r\n\r\n    public static void FindAnswer(Point[] serchPoints) {\r\n        double MinDist;\r\n        Double Sum = 0.0;\r\n        double r = 0.0;\r\n        for (int i = 0; i < serchPoints.length; ++i) {\r\n            MinDist = Double.MAX_VALUE;\r\n            for (int j = 0; j < 3; ++j) {\r\n                r = Math.abs(rectangular[0].getPos()[j] - serchPoints[i].getPos()[j]);\r\n                if (MinDist > r) {\r\n                    MinDist = r;\r\n                }\r\n                r = Math.abs(rectangular[1].getPos()[j] - serchPoints[i].getPos()[j]);\r\n                if (MinDist > r) {\r\n                    MinDist = r;\r\n                }\r\n            }\r\n\r\n            for (int j = i - 1; j >= 0; --j) {\r\n                r = DistOfPoint(serchPoints[i], serchPoints[j]) - serchPoints[j].getR();\r\n                if (r <= 0) {\r\n                    serchPoints[i].setR(0);\r\n                    MinDist = 0.0;\r\n                    break;\r\n                }\r\n                if (MinDist > r) {\r\n                    MinDist = r;\r\n                }\r\n            }\r\n            serchPoints[i].setR(MinDist);\r\n            //System.out.println(MinDist);\r\n            Sum += MinDist * MinDist * MinDist * 3.14159265358979323846 * 4.0 / 3.0;\r\n\r\n        }\r\n        if (MaxSum < Sum) {\r\n            MaxSum = Sum;\r\n        }\r\n    }\r\n\r\n    public static double DistOfPoint(Point a, Point b) {\r\n        return Math.sqrt((a.getPos()[0] - b.getPos()[0]) * (a.getPos()[0] - b.getPos()[0])\r\n                + (a.getPos()[1] - b.getPos()[1]) * (a.getPos()[1] - b.getPos()[1])\r\n                + (a.getPos()[2] - b.getPos()[2]) * (a.getPos()[2] - b.getPos()[2]));\r\n\r\n    }\r\n}\r\n\r\nclass Point {\r\n\r\n    private int[] pos;\r\n    private double r;\r\n\r\n    public Point(int[] pos) {\r\n        this.pos = pos;\r\n    }\r\n\r\n    public int[] getPos() {\r\n        return pos;\r\n    }\r\n\r\n    public double getR() {\r\n        return r;\r\n    }\r\n\r\n    public void setR(double r) {\r\n        this.r = r;\r\n    }\r\n}\r\n','1 2\r\n89323 1\r\n','3\r\n89324\r\n','Box 1: 860016902\r\n\r\nBox 2: 805101259\r\n\r\nBox 3: 992021817\r\n\r\nBox 4: 948707255\r\n\r\nBox 5: 894437958\r\n\r\nBox 6: 706482026\r\n\r\nBox 7: 947739723\r\n\r\nBox 8: 980468279\r\n\r\nBox 9: 854412028\r\n\r\nBox 10: 910183114\r\n\r\nBox 11: 837991917\r\n\r\nBox 12: 926390633\r\n\r\nBox 13: 972290625\r\n\r\nBox 14: 827469370\r\n\r\nBox 15: 858268375\r\n\r\nBox 16: 980528601\r\n\r\nBox 17: 883081498\r\n\r\nBox 18: 905688505\r\n\r\nBox 19: 889802262\r\n\r\nBox 20: 991282684\r\n\r\nBox 21: 820753168\r\n\r\nBox 22: 883851562\r\n\r\nBox 23: 950476721\r\n\r\nBox 24: 873532088\r\n\r\nBox 25: 961722843\r\n\r\nBox 26: 735733177\r\n\r\nBox 27: 819951195\r\n\r\nBox 28: 978387397\r\n\r\nBox 29: 877386727\r\n\r\nBox 30: 630812074\r\n',1000,64000,1,'3\r\n144 -384 -377\r\n1144 616 623\r\n881 311 -178\r\n290 422 314\r\n426 41 137\r\n5\r\n83 433 413\r\n1083 1433 1413\r\n698 930 418\r\n461 1077 1002\r\n426 730 524\r\n1048 915 660\r\n660 1083 766\r\n4\r\n-144 217 236\r\n856 1217 1236\r\n179 243 603\r\n827 1118 571\r\n474 338 620\r\n811 587 1129\r\n5\r\n-492 95 256\r\n508 1095 1256\r\n-350 465 290\r\n424 251 589\r\n180 168 488\r\n57 883 783\r\n158 732 1060\r\n3\r\n-387 -191 -265\r\n613 809 735\r\n256 577 141\r\n174 294 699\r\n-113 520 374\r\n6\r\n-48