280,'Gambling',0,0,'',NULL,NULL,NULL,NULL,NULL,1000,64000,1,NULL),(282,'Teleports',0,0,'',NULL,NULL,NULL,NULL,NULL,1000,64000,1,NULL),(284,'The Labirynth of Wells',0,0,'',NULL,NULL,NULL,NULL,NULL,1000,64000,1,NULL),(285,'Chase',0,0,'',NULL,NULL,NULL,NULL,NULL,1000,64000,1,NULL),(292,'CONFERENCE CALL',0,0,'',NULL,NULL,NULL,NULL,NULL,1000,64000,1,NULL),(293,'MEETING',0,0,'',NULL,NULL,NULL,NULL,NULL,1000,64000,1,NULL),(305,'A Game on the Chessboard',0,0,'',NULL,NULL,NULL,NULL,NULL,1000,64000,1,NULL),(10001,'A+B Problem',16,26,'',NULL,NULL,NULL,NULL,NULL,1000,64000,1,NULL),(10002,'Rooks',0,1,'You have unexpectedly become the owner of a large chessboard, having fifteen squares to each side. Because you do not know how to play chess on such a large board, you find an alternative way to make use of it.\n\nIn chess, a rook attacks all squares that are in the same row or column of the chessboard as it is. For the purposes of this problem, we define a rook as also attacking the square on which it is already standing.\n\nGiven a set of chessboard squares, how many rooks are needed to attack all of them?','Input consists of a number of test cases. Each test case consists of fifteen lines each containing fifteen characters depicting the chess board. Each character is either a period (.) or a hash (#). Every chessboard square depicted by a hash must be attacked by a rook. After all the test cases, one more line of input appears. This line contains the word END.','Output consists of exactly one line for each test case. The line contains a single integer, the minimum number of rooks that must be placed on the chess board so that every square marked with a hash is attacked.','...............\r\n...............\r\n...............\r\n...............\r\n...............\r\n...............\r\n...............\r\n.......#.......\r\n...............\r\n...............\r\n...............\r\n...............\r\n...............\r\n...............\r\n...............\r\nEND\r\n','1',NULL,1000,64000,2,NULL),(10003,'Pipes',0,0,'After writing a solver for the \"moveable maze\" game last week, you have grown tired of it. After all, you already know the optimal solution. To entertain yourself, you find another puzzle game called \"Pipes\", and play that for a while. On one puzzle, you have not been able to find a solution by hand, and you think that there is no solution. You decide to write a program to tell you whether this is the case.\n\nThe game is played on a grid with R rows and C columns. Each square of the grid contains a black dot in the centre and black lines in the direction of some, none, or all of its north, east, south, and west neighbouring squares, with the following restriction: if two opposite directions both have lines, then at least one of the other two directions has a line as well. In other words, it is forbidden for a square to consist of a straight line.\n\nThe objective of the game is to rotate each square, as many times as you like, such that for each square, if it has a line going in a compass direction (that is, north, east, south, or west), then it has a neighbour in that compass direction and that neighbour has a line going in the opposite compass direction. In other words, each edge in the grid should either have a line on both sides or neither side.\n\nYour task is to determine whether a given grid has a solution. ','The input consists of several test cases.\n\nThe first line of each test case contains the two integers R and C, separated by spaces, with 1 <= R,C <= 12.\n\nThe following R lines of input each contain one row of the grid, from north to south. Each of these lines contains exactly C strings of letters, separated by spaces, that correspond to squares of the grid, from west to east. Their format is as follows:\n\n    * If the string is the single character x, then the square does not contain a line to any of its neighbours.\n    * Otherwise, the string contains some of the characters N, E, S, W, which indicate that a black line extends from this square\'s centre in the direction of its north, east, south, or west neighbour, respectively. No character will appear in the string more than once. \n\nInput is terminated by a line containing 0 0. These zeros are not a test case and should not be processed. ','For each test case, output SOLVABLE if there is a solution to the puzzle, and UNSOLVABLE otherwise. ','3 3\r\nNW NW x\r\nNES NESW W\r\nE W x\r\n2 2\r\nES x\r\nx N\r\n0 0\r\n','SOLVABLE\r\nUNSOLVABLE\r\n',NULL,1000,64000,3,NULL),(3,'Gone Fishing',0,1,'',NULL,NULL,NULL,NULL,NULL,1000,64000,1,NULL);
