n'),(6,2,29,3,3,184,20564,'2010-06-22 18:50:42','\r\nimport java.io.BufferedReader;\r\nimport java.io.FileNotFoundException;\r\nimport java.io.IOException;\r\nimport java.io.InputStreamReader;\r\n\r\n/**\r\n *\r\n * @author MicroSky\r\n */\r\npublic class Main {\r\n\r\n    public static void main(String[] args) throws FileNotFoundException, IOException {\r\n        BufferedReader br = new BufferedReader(new InputStreamReader(System.in));\r\n        System.out.println(\"fdsa\");\r\n        //StringTokenizer st = new StringTokenizer(br.readLine());\r\n    }\r\n}\r\n'),(7,10001,29,7,3,NULL,NULL,'2010-06-22 21:45:18','import java.io.*;\r\nimport java.util.*;\r\npublic class Main\r\n{\r\n            public static void main(String args[]) throws Exception\r\n            {\r\n                    Scanner cin=new Scanner(System.in);\r\nwhile(scan.hasNext()){\r\n                    int a=cin.nextInt(),b=cin.nextInt();\r\n                    System.out.println(a+b);\r\n}\r\n            }\r\n}'),(8,10001,29,7,3,NULL,NULL,'2010-06-22 21:46:22','/*\r\n * To change this template, choose Tools | Templates\r\n * and open the template in the editor.\r\n */\r\npackage oj;\r\n\r\n/**\r\n *\r\n * @author MicroSky\r\n */\r\nimport java.io.*;\r\nimport java.util.*;\r\n\r\npublic class NewClass {\r\n\r\n    public static void main(String args[]) throws Exception {\r\n        Scanner cin = new Scanner(System.in);\r\n        while (cin.hasNext()) {\r\n            int a = cin.nextInt(), b = cin.nextInt();\r\n            System.out.println(a + b);\r\n        }\r\n    }\r\n}\r\n'),(9,10001,29,9,3,NULL,NULL,'2010-06-22 21:46:40','/*\r\n * To change this template, choose Tools | Templates\r\n * and open the template in the editor.\r\n */\r\npackage oj;\r\n\r\n/**\r\n *\r\n * @author MicroSky\r\n */\r\nimport java.io.*;\r\nimport java.util.*;\r\n\r\npublic class Main{\r\n\r\n    public static void main(String args[]) throws Exception {\r\n        Scanner cin = new Scanner(System.in);\r\n        while (cin.hasNext()) {\r\n            int a = cin.nextInt(), b = cin.nextInt();\r\n            System.out.println(a + b);\r\n        }\r\n    }\r\n}\r\n'),(10,10001,29,3,3,192,21024,'2010-06-22 21:47:25','\r\n/**\r\n *\r\n * @author MicroSky\r\n */\r\nimport java.io.*;\r\nimport java.util.*;\r\n\r\npublic class Main{\r\n\r\n    public static void main(String args[]) throws Exception {\r\n        Scanner cin = new Scanner(System.in);\r\n        while (cin.hasNext()) {\r\n            int a = cin.nextInt(), b = cin.nextInt();\r\n            System.out.println(a + b);\r\n        }\r\n    }\r\n}\r\n'),(11,1,29,3,3,340,22800,'2010-06-22 22:28:08','\r\nimport java.io.FileNotFoundException;\r\nimport java.io.IOException;\r\nimport java.text.DecimalFormat;\r\nimport java.util.HashSet;\r\nimport java.util.Scanner;\r\n\r\n/**\r\n *\r\n * @author MicroSky\r\n */\r\npublic class Main {\r\n\r\n    private static double MaxSum;\r\n    private static Point[] rectangular;\r\n    private static int n;\r\n\r\n    public static void main(String[] args) throws FileNotFoundException, IOException {\r\n        Scanner scan = new Scanner(System.in);\r\n\r\n\r\n        n = scan.nextInt();\r\n        int count = 0;\r\n        while (scan.hasNext()) {\r\n            count++;\r\n\r\n            rectangular = new Point[2];\r\n            for (int i = 0; i < 2; ++i) {\r\n                rectangular[i] = new Point(new int[3]);\r\n                for (int j = 0; j < 3; ++j) {\r\n                    rectangular[i].getPos()[j] = scan.nextInt();\r\n                }\r\n            }\r\n            Point[] points = new Point[n];\r\n            for (int i = 0; i < n; ++i) {\r\n                points[i] = new Point(new int[3]);\r\n                for (int j = 0; j < 3; ++j) {\r\n                    points[i].getPos()[j] = scan.nextInt();\r\n                }\r\n            }\r\n            MaxSum = 0;\r\n            Point[] serchPoints = new Point[n];\r\n            for (int i = 0; i < n; ++i) {\r\n                serchPoints[i] = new Point(new int[3]);\r\n            }\r\n            HashSet<Integer> HaveSearch = new HashSet<Integer>();\r\n            AllSearch(HaveSearch, n, 0, serchPoints, points);\r\n            double area = 1.0;\r\n            for (int j = 0; j < 3; ++j) {\r\n                area *= Math.abs(rectangular[0].getPos()[j] - rectangular[1].getPos()[j]);\r\n            }\r\n            DecimalFormat df = new DecimalFormat(\"#\");\r\n            System.out.println(\"Box \" + count + \": \"+ df.format(area - MaxSum));\r\n            System.out.println();\r\n            n = scan.nextInt();\r\n        }\r\n    }\r\n\r\n    public static void AllSearch(HashSet<Integer> HaveSearch, int n, int deep, Point[] serchPoints, Point[] points) {\r\n        if (deep == n) {\r\n            FindAnswer(serchPoints);\r\n        }\r\n        for (int i = 0; i < n; ++i) {\r\n            if (HaveSearch.contains(i) == false) {\r\n                HaveSearch.add(i);\r\n                serchPoints[deep] = points[i];\r\n                AllSearch(HaveSearch, n, deep + 1, serchPoints, points);\r\n                HaveSearch.remove(i);\r\n            }\r\n        }\r\n    }\r\n\r\n    public static void FindAnswer(Point[] serchPoints) {\r\n        double MinDist;\r\n        Double Sum = 0.0;\r\n        double r = 0.0;\r\n        for (int i = 0; i < serchPoints.length; ++i) {\r\n            MinDist = Double.MAX_VALUE;\r\n            for (int j = 0; j < 3; ++j) {\r\n                r = Math.abs(rectangular[0].getPos()[j] - serchPoints[i].getPos()[j]);\r\n                if (MinDist > r) {\r\n                    MinDist = r;\r\n                }\r\n                r = Math.abs(rectangular[1].getPos()[j] - serchPoints[i].getPos()[j]);\r\n                if (MinDist > r) {\r\n                    MinDist = r;\r\n                }\r\n            }\r\n\r\n            for (int j = i - 1; j >= 0; --j) {\r\n                r = DistOfPoint(serchPoints[i], serchPoints[j]) - serchPoints[j].getR();\r\n                if (r <= 0) {\r\n                    serchPoints[i].setR(0);\r\n                    MinDist = 0.0;\r\n                    break;\r\n                }\r\n                if (MinDist > r) {\r\n                    MinDist = r;\r\n                }\r\n            }\r\n            serchPoints[i].setR(MinDist);\r\n            //System.out.println(MinDist);\r\n            Sum += MinDist * MinDist * MinDist * 3.14159265358979323846 * 4.0 / 3.0;\r\n\r\n        }\r\n        if (MaxSum < Sum) {\r\n            MaxSum = Sum;\r\n        }\r\n    }\r\n\r\n    public static double DistOfPoint(Point a, Point b) {\r\n        return Math.sqrt((a.getPos()[0] - b.getPos()[0]) * (a.getPos()[0] - b.getPos()[0])\r\n                + (a.getPos()[1] - b.getPos()[1]) * (a.getPos()[1] - b.getPos()[1])\r\n                + (a.getPos()[2] - b.getPos()[2]) * (a.getPos()[2] - b.getPos()[2]));\r\n\r\n    }\r\n}\r\n\r\nclass Point {\r\n\r\n    private int[] pos;\r\n    private double r;\r\n\r\n    public Point(int[] pos) {\r\n        this.pos = pos;\r\n    }\r\n\r\n    public int[] getPos() {\r\n        return pos;\r\n    }\r\n\r\n    public double getR() {\r\n        return r;\r\n    }\r\n\r\n    public void setR(double r) {\r\n        this.r = r;\r\n    }\r\n}\r\n'),(12,1,3,7,1,NULL,NULL,'2011-02-17 06:37:55','#include <iostream>\r\nusing namespace std;\r\nint main(){\r\ncout<<\\\"1\\\"<<endl;\r\nreturn 0;\r\n}'),(13,1,3,7,1,NULL,NULL,'2011-02-17 06:56:49','#include <iostream>\r\nusing namespace std;\r\nint main(){\r\ncout<<\\\"1\\\"<<endl;\r\nreturn 0;\r\n}'),(14,1,3,7,1,NULL,NULL,'2011-02-17 07:00:13','#include <iostream>\r\nusing namespace std;\r\nint main(){\r\ncout<<\\\"1\\\"<<endl;\r\nreturn 0;\r\n}'),(15,1,3,4,1,0,632,'2011-02-17 07:03:47','#include <iostream>\r\nusing namespace std;\r\nint main(){\r\ncout<<\"1\"<<endl;\r\nreturn 0;\r\n}'),(16,10001,3,3,1,0,668,'2011-02-17 07:05:27','#include <iostream>\r\nusing namespace std;\r\nint main(){\r\nint a,b;\r\nwhile(cin>>