\n    return min(mi,tz);\r\n}\r\ndouble dis(point u,point v)\r\n{\r\n    double tx,ty,tz;\r\n    tx=u.x-v.x;\r\n    ty=u.y-v.y;\r\n    tz=u.z-v.z;\r\n    return sqrt(tx*tx+ty*ty+tz*tz);\r\n}\r\n\r\nint main()\r\n{\r\n    int i,j,ca=0;\r\n    double mi,tp,ans,vol,v;\r\n    while(scanf(\"%d\",&n)==1)\r\n    {\r\n        i=0;\r\n        while(i<2)\r\n        {\r\n            scanf(\"%lf%lf%lf\",&x[i],&y[i],&z[i]);\r\n            i++;\r\n        }\r\n        vol=fabs((x[0]-x[1])*(y[0]-y[1])*(z[0]-z[1]));\r\n        i=0;\r\n        while(i<n)\r\n        {\r\n            scanf(\"%lf%lf%lf\",&p[i].x,&p[i].y,&p[i].z);\r\n            d[i]=sd(p[i]);\r\n            a[i]=i;\r\n            i++;\r\n        }\r\n        ans=0;\r\n        do\r\n        {\r\n            i=0;\r\n            while(i<n)\r\n                r[i++]=0.0;\r\n            v=0;\r\n            i=0;\r\n            while(i<n)\r\n            {\r\n                mi=d[a[i]];\r\n                j=0;\r\n                while(j<n)\r\n                {\r\n                    if(j!=a[i]&&dblcmp(r[j])>0)\r\n                    {\r\n                        tp=dis(p[a[i]],p[j])-r[j];\r\n                        if(dblcmp(tp)<0)\r\n                        {\r\n                            mi=0.0;\r\n                            break;\r\n                        }\r\n                        if(dblcmp(tp-mi)<0)\r\n                            mi=tp;\r\n                    }\r\n                    j++;\r\n                }\r\n                r[a[i++]]=mi;\r\n                v+=mi*mi*mi;\r\n            }\r\n            if(dblcmp(v-ans)>0)\r\n                ans=v;\r\n        }while(next_permutation(a,a+n));\r\n        printf(\"Box %d: %.0lf\\n\",++ca,vol-4.0/3.0*pi*ans);\r\n    }\r\n    return 0;\r\n}'),(42,1,49,4,1,2,748,'2012-03-22 05:34:18','#include<iostream>\r\n#include<cmath>\r\n#include<algorithm>\r\n#include <stdio.h>\r\nusing namespace std;\r\n\r\n#define eps 1e-8\r\n#define pi acos(-1.0)\r\n\r\nstruct point\r\n{\r\n    do