mi;\r\n                v+=mi*mi*mi;\r\n            }\r\n            if(dblcmp(v-ans)>0)\r\n                ans=v;\r\n        }while(next_permutation(a,a+n));\r\n        printf(\"Box %d: %.0lf\\n\",++ca,vol-4.0/3.0*pi*ans);\r\n    }\r\n    return 0;\r\n}\r\n'),(43,48,51,4,1,0,0,'2012-04-22 06:24:28','#include<stdio.h>\r\n#include<stdlib.h>\r\n#include<string.h>\r\n#include<iostream>\r\n#include<math.h>\r\n#include<vector>\r\n#include<algorithm>\r\n#include<queue>\r\nusing namespace std;\r\nint effor(int x , int y)\r\n{\r\n    if(x == 1 && y == 3)return 4;\r\n    if(x == 3 && y == 1)return 4;\r\n    if(x == 2 && y == 4)return 4;\r\n    if(x == 4 && y == 2)return 4;\r\n    if(x == 0)return 2;\r\n    if(y == 0)return 2;\r\n    if(x == y)return 1;\r\n    if(x == 1 && y == 2)return 3;\r\n    if(x == 1 && y == 4)return 3;\r\n    if(y == 1 && x == 2)return 3;\r\n    if(x == 2 && y == 3)return 3;\r\n    if(x == 3 && y == 2)return 3;\r\n    if(x == 3 && y == 4)return 3;\r\n    if(x == 4 && y == 3)return 3;\r\n    if(x == 4 && y == 1)return 3;\r\n}\r\nconst int mn = 111111;\r\nint dp[mn][5][5],test[mn];\r\nint main()\r\n{\r\n   // freopen(\"in1.txt\",\"r\",stdin);\r\n   // freopen(\"ou1.txt\",\"w\",stdout);\r\n    int n;\r\n    while(scanf(\"%d\",&test[1]) && test[1] != 0)\r\n    {\r\n        n = 1;\r\n        for(int i = 2 ;  ; i++)\r\n        {\r\n            scanf(\"%d\",&test[i]);\r\n            if(test[i] == 0)break;\r\n            n = i;\r\n        }\r\n        memset(dp,0x3f3f3f3f,sizeof(dp));\r\n        //0...1.up..2 right . 3 down  4 left\r\n        dp[n+1][test[n-1]][test[n]] = 0;\r\n        dp[n+1][test[n]][test[n-1]] = 0;\r\n        for(int i = n ; i >= 1 ; i--)\r\n        {\r\n            for(int j = 0 ; j <= 4 ; j++)\r\n            {\r\n                for(int k = 0 ; k <= 4 ; k++)\r\n                {\r\n                    dp[i][j][k] = min(dp[i+1][j][test[i]] + effor(k,test[i]) , dp[i+1][test[i]][k] + effor(j,test[i]));\r\n                  //  printf(\"%d   %d   %d  %d\\n\",i,j,k,dp[i][j][k]);\r\n                }\r\n            }\r\n\r\n        }\r\n        printf(\"%d\\n\",dp[1][0][0]);\r\n    }\r\n}\r\n'),(44,48,51,4,1,0,0,'2012-04-22 06:25:03','#include<stdio.h>\r\n#include<stdlib.h>\r\n#include<string.h>\r\n#include<iostream>\r\n#include<math.h>\r\n#include<vector>\r\n#include<algorithm>\r\n#include<queue>\r\nusing namespace std;\r\nint effor(int x , int y)\r\n{\r\n    if(x == 1 && y == 3)return 4;\r\n    if(x == 3 && y == 1)return 4;\r\n    if(x == 2 && y == 4)return 4;\r\n    if(x == 4 && y == 2)return 4;\r\n    if(x == 0)return 2;\r\n    if(y == 0)return 2;\r\n    if(x == y)return 1;\r\n    if(x == 1 && y == 2)return 3;\r\n    if(x == 1 && y == 4)return 3;\r\n    if(y == 1 && x == 2)return 3;\r\n    if(x == 2 && y == 3)return 3;\r\n    if(x == 3 && y == 2)return 3;\r\n    if(x == 3 && y == 4)return 3;\r\n    if(x == 4 && y == 3)return 3;\r\n    if(x == 4 && y == 1)return 3;\r\n}\r\nconst int mn = 111111;\r\nint dp[mn][5][5],test[mn];\r\nint main()\r\n{\r\n   // freopen(\"in1.txt\",\"r\",stdin);\r\n   // freopen(\"ou1.txt\",\"w\",stdout);\r\n    int n;\r\n    while(scanf(\"%d\",&test[1]) && test[1] != 0)\r\n    {\r\n        n = 1;\r\n        for(int i = 2 ;  ; i++)\r\n        {\r\n            scanf(\"%d\",&test[i]);\r\n            if(test[i] == 0)break;\r\n            n = i;\r\n        }\r\n        memset(dp,0x3f3f3f3f,sizeof(dp));\r\n        //0...1.up..2 right . 3 down  4 left\r\n        dp[n+1][test[n-1]][test[n]] = 0;\r\n        dp[n+1][test[n]][test[n-1]] = 0;\r\n        for(int i = n ; i >= 1 ; i--)\r\n        {\r\n            for(int j = 0 ; j <= 4 ; j++)\r\n            {\r\n                for(int k = 0 ; k <= 4 ; k++)\r\n                {\r\n                    dp[i][j][k] = min(dp[i+1][j][test[i]] + effor(k,test[i]) , dp[i+1][test[i]][k] + effor(j,test[i]));\r\n                  //  printf(\"%d   %d   %d  %d\\n\",i,j,k,dp[i][j][k]);\r\n                }\r\n            }\r\n\r\n        }\r\n        printf(\"%d\\n\",dp[1][0][0]);\r\n    }\r\n}\r\n'),(45,48,54,4,1,0,0,'2012-05-07 02:33:21','#include <iostream>\r\n#include <cstdio>\r\n#include <cstring>\r\n#include <cstdlib>\r\n#include <stack>\r\n#include <cmath>\r\n#include <algorithm>\r\n\r\n\r\n#define CL(arr, val)    memset(arr, val, sizeof(arr))\r\n#define REP(i, n)       for(i = 0; i < n; ++i)\r\n#define FOR(i, l, h)    for(i = l; i <= h; ++i)\r\n#define FORD(i, h, l)   for(i = h; i >= l; --i)\r\n#define L(x)    x << 1\r\n#define R(x)    x << 1 | 1\r\n#define MID(l, r)  (l + r) >> 1\r\ntypedef long long LL;\r\n\r\nusing namespace std;\r\n\r\nconst int N = 5024;\r\nconst int inf = ~0u>>2;\r\n\r\nint dp[5][5][N];\r\nbool vis[5][5][N];\r\nint a[N], n;\r\n\r\nint sum(int x, int y) {\r\n    if(x == y)  return 1;\r\n    if(x == 0)  return 2;\r\n    if(x - y == 1 || y - x == 1 || x - y == 3 || y - x == 3)    return 3;\r\n    if(x - y == 2 || y - x == 2)    return 4;\r\n}\r\n\r\nint dfs(int x, int y, int k) {\r\n    if(vis[x][y][k])    return dp[x][y][k];\r\n    if(k == n - 1) {\r\n        dp[x][y][k] = min(sum(x, a[k]), sum(y, a[k]));\r\n        vis[x][y][k] = true;\r\n        return dp[x][y][k];\r\n    }\r\n\r\n    int t;\r\n    t = min(dfs(x, a[k], k + 1) + sum(y, a[k]), dfs(a[k], y, k + 1) + sum(x, a[k]));\r\n    dp[x][y][k] = t;\r\n    vis[x][y][k] = true;\r\n    return t;\r\n}\r\n\r\nint main() {\r\n    //freopen(\"data.in\", \"r\", stdin);\r\n\r\n    while(1) {\r\n        n = 0;\r\n        while(scanf(\"%d\", &a[n]), a[n]) n++;\r\n        if(a[0] == 0)   break;\r\n        CL(dp, 0);\r\n        CL(vis, 0);\r\n        printf(\"%d\\n\", dfs(0, 0, 0));\r\n    }\r\n    return 0;\r\n}\r\n'),(46,10001,56,3,1,0,700,'2012-05-31 14:45:16','#include <iostream>\r\nusing namespace std;\r\nint main() {\r\n    int a, b;\r\n    while (cin >> a >> b) {\r\n        cout << a + b << endl;\r\n    }\r\n    return 0;\r\n}'),(47,11,58,7,1,NULL,NULL,'2012-06-05 22:18:49','#include<cstdio>\r\n\r\nint main(){\r\nwhile(1)\r\n}'),(48,11,58,4,1,0,0,'2012-06-05 22:18:59','#include<cstdio>\r\n\r\nint main(){\r\nwhile(1);\r\n}'),(49,10001,58,3,1,0,520,'2012-06-05 22:19:58','#include <cstdio>\r\n\r\nint main(){\r\nint a,b;\r\nscanf(\"%d%d\",&a,&b);\r\nprintf(\"%d\\n\",a+b);\r\n}'),(50,11,58,4,1,0,0,'2012-06-05 23:39:47','#include <cstdio>\r\n#include <set>\r\n#include <algorithm>\r\nusing namespace std;\r\n\r\nconst int mn = 100, mm = mn * (mn - 1) / 2;\r\nint n, m, s[mm], a[mn];\r\n\r\nbool get_solution(int b1, int b2, int b3, int &x1, int &x2, int &x3) {\r\n	const int det = -2;\r\n	int d1 = -b1 - b2 + b3;\r\n	int d2 = -b1 + b2 - b3;\r\n	int d3 = b1 - b2 - b3;\r\n	if (d1 % det != 0 || d2 % det != 0 || d3 % det != 0)\r\n		return 0;\r\n	x1 = d1 / det;\r\n	x2 = d2 / det;\r\n	x3 = d3 / det;\r\n	return 1;\r\n}\r\n\r\nint main() {\r\n	int T;\r\n	scanf(\"%d\", &T);\r\n	while (T--) {\r\n		scanf(\"%d\", &n);\r\n		m = n * (n - 1) / 2;\r\n		for (int i = 0; i < m; ++i)\r\n			scanf(\"%d\", s + i);\r\n		sort(s, s + m);\r\n\r\n		int nsol = 0;\r\n		for (int i = 2; i <= n && s[i] <= s[0] + s[1]; ++i) {\r\n			bool integral = get_solution(s[0], s[1], s[i], a[0], a[1], a[2]);\r\n			if (integral) {\r\n				++nsol;\r\n				multiset<int> sums;\r\n				for (int j = 2; j < m; ++j)\r\n					if (j != i)\r\n						sums.insert(s[j]);\r\n				for (int j = 3; j < n; ++j) {\r\n					a[j] = *sums.begin() - a[0];\r\n					for (int k = 0; k < j; ++k)\r\n						sums.erase(sums.find(a[k] + a[j]));\r\n				}\r\n			}\r\n		}\r\n		if (nsol) {\r\n//			if (nsol > 1)\r\n//				puts(\"more than one solutions!\");\r\n			for (int i = 0; i < n; ++i) {\r\n				if (i)\r\n					putchar(\' \');\r\n				printf(\"%d\", a[i]);\r\n			}\r\n			putchar(\'\\n\');\r\n		} else {\r\n			puts(\"-1\");\r\n		}\r\n\r\n	}\r\n\r\n	return 0;\r\n}\r\n'),(51,11,58,4,1,0,0,'2012-06-05 23:41:46','#include <cstdio>\r\n#include <set>\r\n#include <algorithm>\r\nusing namespace std;\r\n\r\nconst int mn = 100, mm = mn * (mn - 1) / 2;\r\nint n, m, s[mm], a[mn];\r\n\r\nbool get_solution(int b1, int 